import React from "react";
import "./styles/landing.css";

export default function Landing() {
  return (
    <div className="landing">
      <div className="content">
        <h1>BUY</h1>
        <h1>SELL</h1>
        <p>And browse many different phones.</p>
      </div>
    </div>
  );
}
